func (c *current) onNonEmptyListLiteral1(first, rest interface{}) (interface{}, error) {
	exprs := rest.([]interface{})
	content := make(NonEmptyList, len(exprs)+1)
	content[0] = first.(Term)
	for i, expr := range exprs {
		content[i+1] = expr.(Term)
	}
	return content, nil

}

